import { CubesIcon } from '@patternfly/react-icons';
import { Link } from 'react-router-dom';
import { StateCard } from '../EmptyStates/StateCard';
import { PageLayout } from '../PageLayout/PageLayout';

export enum FailedPageType {
  PageNotFound,
  KeycloakFailed,
}

interface IKeycloakFailedPage {
  title?: string;
  errorTitle: string;
  errorDescription: string;
}

export const KeycloakFailedPage = ({ title, errorTitle, errorDescription }: IKeycloakFailedPage) => {
  return (
    <PageLayout title={title ? title : 'Page not found'}>
      <StateCard title={`Error when loading ${title}`} icon={CubesIcon}>
        <pre>errorDescription</pre>
        <Link style={{ margin: '15px' }} to="/" className="pf-c-button pf-m-primary">
          Return to Dashboard
        </Link>
      </StateCard>
      {type === FailedPageType.PageNotFound && (
        <StateCard title={`404: Page does not exist`} icon={CubesIcon}>
          <pre>The requested resource could not be found.</pre>
          <Link style={{ margin: '15px' }} to="/" className="pf-c-button pf-m-primary">
            Return to Dashboard
          </Link>
        </StateCard>
      )}
    </PageLayout>
  );
};
